import React, { Component } from "react";
import { Link } from "react-router-dom";


class CustomerNav extends Component {

    constructor(props) {
        super(props);

        this.state = {
            cart_closed: true,
        }
    }

    handleOnclickLogin = (e) => {
        e.preventDefault();
        this.state.cart_closed ? this.setState({ cart_closed: false, }) : this.setState({ cart_closed: true, });
    }

    render() {
        return (

            <nav className={"second-menu"} >
                <ul>
                    <li>
                        <Link to="/bookings">
                            <button className={""}>Bokningar</button>
                        </Link>
                    </li>
                    {this.state.cart_closed ?
                        <li>
                            <form onSubmit={this.handleOnclickLogin}>
                                <button className={""} onClick={this.handleOnclickLogin} >Kundvagn</button>
                            </form>
                        </li>
                        :
                        <li>
                            <form onSubmit={this.handleOnclickLogin}>
                                <button className={""} onClick={this.handleOnclickLogin} >Kundvagn</button>
                            </form>
                            <ul>
                                <li>
                                    <table>
                                        <thead>
                                            <tr>
                                                <th>

                                                </th>
                                            </tr>
                                        </thead>
                                        <tbody>
                                            <tr>
                                                <td>

                                                </td>
                                            </tr>
                                        </tbody>
                                    </table>
                                </li>
                                <li>

                                </li>
                            </ul>
                        </li>
                    }

                </ul>
            </nav>

        )
    }
}

export default CustomerNav;
